import React, { useState, useEffect } from 'react';
import './App.css';
import MapComponent from './MapComponent';

// The backend API endpoint
const API_URL = 'http://localhost:5000/api/reports';

function App() {
  // State for the list of reports
  const [reports, setReports] = useState([]);
  // State for the form inputs
  const [groupName, setGroupName] = useState('');
  const [activityType, setActivityType] = useState('Food Distribution');
  const [description, setDescription] = useState('');
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');

  // Fetch reports from the backend when the component mounts
  useEffect(() => {
    fetch(API_URL)
      .then((res) => res.json())
      .then((data) => setReports(data))
      .catch((error) => console.error("Error fetching reports:", error));
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();

    const newReport = {
      groupName,
      activityType,
      description,
      location: {
        lat: parseFloat(latitude),
        lng: parseFloat(longitude),
      },
    };

    // Send the new report to the backend
    fetch(API_URL, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(newReport),
    })
      .then((res) => res.json())
      .then((savedReport) => {
        // Add the new report to the top of the list
        setReports([savedReport, ...reports]);
        // Clear form fields
        setGroupName('');
        setDescription('');
        setLatitude('');
        setLongitude('');
      })
      .catch((error) => console.error("Error submitting report:", error));
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Mutual Aid Activity Mapper</h1>
      </header>
      <main>
        <div className="report-form">
          <h2>Report an Activity</h2>
          <form onSubmit={handleSubmit}>
            <input type="text" value={groupName} onChange={(e) => setGroupName(e.target.value)} placeholder="Group Name" required />
            <select value={activityType} onChange={(e) => setActivityType(e.target.value)}>
              <option>Food Distribution</option>
              <option>Shelter</option>
              <option>Medical Supplies</option>
              <option>Clothing Drive</option>
              <option>Other</option>
            </select>
            <input type="text" value={latitude} onChange={(e) => setLatitude(e.target.value)} placeholder="Latitude" required />
            <input type="text" value={longitude} onChange={(e) => setLongitude(e.target.value)} placeholder="Longitude" required />
            <textarea value={description} onChange={(e) => setDescription(e.target.value)} placeholder="Activity Description..."></textarea>
            <button type="submit">Submit Report</button>
          </form>
        </div>

        <div className="reports-list">
          <h2>Recent Activities</h2>
          {reports.map((report) => (
            <div key={report.id} className="report-item">
              <h3>{report.activityType} by {report.groupName}</h3>
              <p>{report.description}</p>
              <small>Location: ({report.location.lat}, {report.location.lng})</small>
              <small> | Reported: {new Date(report.timestamp).toLocaleString()}</small>
            </div>
          ))}
        </div>

        <div className="map-container">
          <h2>Activity Map</h2>
          <MapComponent reports={reports} />
        </div>
      </main>
    </div>
  );
}

export default App;
